import React , { useState } from 'react';
import Image from 'next/image';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  Container,
  Jumbotron,
  
  
} from 'reactstrap';


function Home() {


   

    const [isOpen, setIsOpen] = useState(false);
    const toggle = () => setIsOpen(!isOpen);

  return (
        <div>
            <Navbar  dark expand="md" className='pg-nav'>
            <style>
          {`.pg-nav{
              background-color: #000;
              
         }`}
      </style>
            
            <Container>
        <NavbarBrand  href="/">Henri Michel</NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav className="mr-auto" navbar>
            <NavItem>
              <NavLink href="/orcamento">Orçamento</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="https://github.com/henri-miche">GitHub</NavLink>
            </NavItem>
          </Nav>
        </Collapse>
        </Container>
      </Navbar>

      <Jumbotron className='pg-home'>
      <style>
          {`.pg-home{
              background-color: #1C1C1C;
              color:  #Fff;
              padding-top:50px;
              padding-bottom:50px;
              margin-bottom:0rem !important;
              border-radius:0px;
         }`}
      </style>
        <Container >
        <style>
             {`.rodape{
                 color:#fff;
                 background-color: #000;
                 padding-top:10px;
                 padding-bottom:10px;
                 margin-bottom:0rem !important;
             }.img{
                 width:100px;
                 height:100px;
             }`}
         </style>
        
            
          <img src='/public/IMG_20200710_124645.jpg' width="200" height='200' border-radius='100px' />              
          <h3 className=" ">Desenvolvimento de aplicações performáticas, Mobile e Web, com foco na experiência de usuário.</h3>
          <p className="lead text-center mb-4">Tecnologias que já utilizei: Node, Firebase, React, React-Native,Bootstrap e Next.</p>
        
        
        
        </Container>
      </Jumbotron>

         <Jumbotron fluid className="rodape">
         <style>
             {`.rodape{
                 color:#fff;
                 background-color: #000;
                 padding-top:10px;
                 padding-bottom:10px;
                 margin-bottom:0rem !important;
             }.img{
                 width:100px;
                 height:100px;
             }`}
         </style>
             <Container>
                <h1 className="lead text-center">Rodapé</h1>
             </Container>
         </Jumbotron>
     
        </div>
  
  );
}

export default Home;
